import styled from "styled-components";

export const Footer = styled.footer`
  background-color: #222;
  height: 50px;
  line-height: 50px;
  margin-top: 80px;
`;

export const Container = styled.div`
  width: 960px;
  margin: 0px auto;
  display: grid;
  grid-column-gap: 20px;
  grid-template-columns: auto auto auto auto;
`;
